      <div >
        <BrowserRouter>
        <Header />
        <Routes>
          <Route index element={<Store />} />
          <Route path="/" element={<Store />}></Route>
          <Route path="/editEmployee/:id" element={<UpdatePage />} />
        </Routes>
      </BrowserRouter>
      </div>
  );
}

export default App;
